public class Base64UploadTest {
    public static void main(String[] args) throws IOException, URISyntaxException {

        BASE64Encoder bs64Encoder = new BASE64Encoder();

        //获取件
        FileInputStream file = new FileInputStream("/Users/haizhi/Desktop/test.png");
        //转码
//        byte[] bytes = translateToByteArray(file).toByteArray();
//        byte[] bytes = bs64Encoder.encode(translateToByteArray(file).toByteArray()).getBytes();
        byte[] bytes = "".getBytes();
//        System.out.println(new String(bytes));

        URI uri = new URIBuilder("http://king.weibangong.com:9091/api/file/upload")
                .addParameter("watermark", "张三的三")
                .addParameter("fileName", "张三.png")
                .addParameter("base64", "true")
                .addParameter("timStamp", new Date().getTime() + "")
                .addParameter("locationShot", "1")
                .build();

        HttpPost post = new HttpPost(uri);

        InputStreamEntity inputStreamEntity = new InputStreamEntity(new ByteArrayInputStream(bytes), ContentType.APPLICATION_OCTET_STREAM);
        post.setEntity(inputStreamEntity);

        ClientConnectionPool clientConnectionPool = new ClientConnectionPool();
        String result = clientConnectionPool.execute(post);

        System.out.println(result);

    }

    private static ByteArrayOutputStream translateToByteArray(InputStream inputStream) throws IOException {
        ByteArrayOutputStream out = new ByteArrayOutputStream();
        IOUtils.copy(inputStream, out);
        return out;
    }
}
